import React, { Component } from 'react';

const GoodDayMessage = () => {
  return (
    <div>
      Good {getWelcomeMessage()}
    </div>
  )
}

function getWelcomeMessage() {
  var d = new Date()
  var t = Date.getTimeOfDay()
  return(String(t))
}

export default GoodDayMessage;
